package trainingTns;

public class NestedForLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=10;
		int j=20;
		for (int t=i;t<=j;t++) {
			for(int innertab=1;innertab<=10;innertab++) {
				System.out.println(t+"*"+innertab+"="+i*j);
			}
			
		}

	}

}
